import React from 'react';

const ImageLinkForm = () =>{
    return (
        <div>
            <p className='f3'>
                {'Insert your picture-link here & see the magic face detection'}
            </p>
            <div>
                <input type='text' className='f3'></input>
                <button>Detect</button>
            </div>
        </div>
    );
}

export default ImageLinkForm;
